<div class="span12"><span style="background-color: rgb(145, 145, 145); color: rgb(254, 247, 240);"><span style="font-size: 8pt; color: rgb(254, 247, 240);"><span style="background-color: rgb(254, 245, 246); font-size: 8pt; color: rgb(169, 169, 169);">&nbsp;Zapraszamy
do przekazywania 1% podatku na wsparcie dzialan Towarzystwa dla Natury i
Czlowieka prowadzonych na rzecz dokumentacji i kontynuacji muzyki
tradycyjnej Roztocza - m.in. serwisu MuzykaRoztocza.pl&nbsp; KRS 0000214186 <a href="http://www.ekolublin.pl/tdnicz/kategoria,1_procent_dla_natury_i_czlowieka">wiecej informacji</a></span> </span></span><br />

<div><span style="font-size: 8pt;"></span><br />
</div>
<div><span style="font-weight: bold;">Witamy w "Przewodniku po muzyce tradycyjnej
Roztocza"&nbsp;</span></div>&nbsp;<br />
Jest to miejsce poswiecone
wiejskiej muzyce (w rozumieniu
in crudo - na surowo, autentycznej) rozleglego obszaru okreslonego jako
"Roztocze i okolice". Nie tylko samej muzyce, ale takze - a
nawet przede wszystkim - jej tworcom, wykonawcom, czyli wiejskim
muzykom.
Przedstawiamy sylwetki i - w miare mozliwosci - nagrania spiewakow,
spiewaczek &nbsp;i instrumentalistow, a takze zespolow spiewaczych i
kapel, ktorych dzialalnosc artystyczna przypadla na okres ostatnich
60-70 lat. W tym takze tych obecnie aktywnych, gdyz "Roztocze i
okolice" to jeden z nielicznych regionow Europy, gdzie tradycyjna&nbsp;muzyka
oraz piesni
wciaz sa wykonywane przez wiejskich mistrzow i mistrzynie, a proces
miedzypokoleniowego przekazu bywa na rozne sposoby podtrzymywany. &nbsp; <br />
&nbsp;<br />
Strona jest przedsiewzieciem
o charakterze
encyklopedycznym, precedensowym, a wiec szczegolnie trudnym.
Dzieki znacznemu nakladowi pracy, w niemalym stopniu terenowej oraz pomocy wielu osob i instytucji, udalo nam sie dotad opublikowac prezentacje ponad 200 wykonawcow i ponad pol tysiaca materialow dzwiekowych i wizualnych. Wiekszosc z nich to unikalne materialy nigdzie wczesniej nie publikowane. Wciaz jednak istnieje potrzeba licznych uzupelnien, wypelnienia bialych plam. Dlatego bardzo liczymy na wspolprace ze strony osob
prywatnych i instytucji, pomoc Panstwa - naszych Czytelnikow, na
wszelkie, nawet
najdrobniejsze informacje, takze fotografie czy materialy audio, a
rowniez na ogolniejsze sugestie. Kazda pomoc bedziemy skrupulatnie
odnotowywac.&nbsp;<br />
